            Assert.Equal(4, result);
        }

        private int FindLengthWithBestUnitToRemove(string data)
        {
            return Enumerable
                .Range('a', 'z' - 'a')
                .Select(i => ((char)i).ToString())
                .Select(c =>
                {
                    var filteredData = data.Replace(c, string.Empty, ignoreCase: true,
                        culture: CultureInfo.InvariantCulture);
                    var result = CalculateReactionResult(filteredData);

                    return new {Character = c, Length = result.Length};
                })
                .OrderBy(d => d.Length)
                .First()
                .Length;
        }

        private string CalculateReactionResult(string polymer)
        {
            var sb = new StringBuilder(polymer);
            var didReact = false;

            for (int i = 1; i < polymer.Length; i++)
            {
                var current = sb[i];
                var previous = sb[i - 1];

                if (Math.Abs(current-previous) == 32)
                {
                    sb[i] = sb[i - 1] = '-';
                    didReact = true;
                    i++;
                }
            }

            var reacted = polymer;

            if (didReact)
            {
                var cleared = sb.ToString();
                reacted = cleared.Replace("-", string.Empty);
                reacted = CalculateReactionResult(reacted);
            }

            return reacted;
        }


